import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
//import '././bootstrap/bootstrap.css';
import './newcss.css';
class TableDiv extends Component {

  

  render (){

    let anrray ={turo:"Perfect Skills",turro:"Networking Skills"}
    let alrray ={turo:"More skills I know",turro:"An yead"}

    return (
        
      <div className="container">
          <table class="table table-hover">
            <thead>
                <tr>
                <th scope="col">#</th>
                <th scope="col">Experiences</th>
                <th scope="col">Increased Revenue?</th>
                <th scope="col">Forecasted?</th>
                <th scope="col">Produced?</th>
                <th scope="col">Excelled?</th>
                <th scope="col">Agile?</th>
                <th scope="col">Competed?</th>
                <th scope="col">Got Promoted?</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                <th scope="row">1</th>
                <td>World Fuel Services</td>
                <td>Yes</td>
                <td>Yes</td>
                <td>Yes</td>
                <td>Yes</td>
                <td>Yes</td>
                <td>Yes</td>
                <td>No</td>
                </tr>
                
            </tbody>
        </table>
      
      </div>

    )
  }
}


//export default FirstDiv;
export default TableDiv;
